div.div:
#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
Как видно, цветами помечены различные концепции, которые уже надо разобрать, чтобы в полной мере осознать как работает базовая программа.
#include <...> - одна из так называемых директив препроцессора, которая вставляет содержимое указанного файла непосредственно в файл с исходным кодом. Т.е. содержимое заголовочного файла iostream скопируется в начало файла с исходным кодом программы.
Отдельно советую обратить внимание: заголовочные файлы библиотек (особенно стандартной) принято заключать в угловые скобки. Другие заголовочные файлы - в кавычки.
